DROP TABLE IF EXISTS officer_encounter;
CREATE TABLE officer_encounter(
   agency_responsible    VARCHAR(68) NOT NULL 
  ,ID                    INTEGER  NOT NULL 
  ,body_cam              VARCHAR(18)
  ,offDuty_Killing       VARCHAR(8)
  ,encounter_Type        VARCHAR(80)
  ,reasons_for_encounter VARCHAR(130)
  ,call_for_service      VARCHAR(11)
  
  ,foreign key (ID) references victim (ID)
);
